What are all the options that a field can have in a mongoose Schema?<p>So basically I am working with <code>mongodb</code> using <code>mongoose</code>. I would like to know what are all the potential options that a field can have in a <code>mongoose</code> schema. For example, a user schema:</p>
<pre><code>const UserSchema = new Schema(
   {
      username: {
         required: true,
         unique: true,
      },
      email: {
         required: true,
         unique: true,
      },
   },
   {
      timestamps: true,
   }
);
</code></pre>
<p>Here the fields of the schema are username and email. The options for these fields are required and unique. What are <em><strong>ALL</strong></em> the options that a field can have in a <code>mongoose</code> Schema? I found schema options in the <code>mongoose</code> docs but it talks about <code>autoIndex</code> and all this other stuff that is not relevant to my question. So again my question is what are all the options that a field can have in a <code>mongoose</code> schema. Thank You!</p>

