passing parameter through axios post call<p>I have this (my whole page):</p>
<pre><code> import { render } from &quot;react-dom&quot;;
import React, { Component } from &quot;react&quot;;
import axios from &quot;axios&quot;;
import &quot;../styles/TourPage.css&quot;;

class TourPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      myData: [],
      isLoading: true
    };
  }

  componentDidMount() {
    axios
      .get(&quot;/getResults&quot;)
      .then((res) =&gt; {
        this.setState({
          myData: res.data
        });
      })
      .catch((error) =&gt; {
        // Handle the errors here
        console.log(error);
      })
      .finally(() =&gt; {
        this.setState({
          isLoading: false
        });
      });
  }

  deleteById = (id) =&gt; {

    console.log(id)
    axios
      .post(`/deleteDoc`, id )
      .then(() =&gt; {
        console.log(id, &quot; worked&quot;)
      })
      .catch((error) =&gt; {
        // Handle the errors here
        console.log(error);

  })
}
  render() {
    // You can handle the loader part here with isLoading flag. In this case No data found will be shown initially and then the actual data
    let { myData, isLoading } = this.state;
    return (
      &lt;table id=&quot;customers&quot;&gt;
        &lt;tr&gt;
          &lt;th&gt;siteLocation&lt;/th&gt;
          &lt;th&gt;Services&lt;/th&gt;
          &lt;th&gt;cnum&lt;/th&gt;
        &lt;/tr&gt;
        {myData.length &gt; 0
          ? myData.map(({ location, Services, cnum, _id }, index) =&gt; (
