                &gt;
                  Delete
                &lt;/button&gt;
              &lt;/tr&gt;
            ))
          : &quot;No Data Found&quot;}
      &lt;/table&gt;
    );
  }
}

export default TourPage;
</code></pre>
<p>what it does is basically load the results from the database, and then If I want to delete them, I click the button, and it delete them. pretty straight forward stuff. My issue is, when I click the delete button, and it makes the axios post request, it doesn't actually pass the <code>id</code> to the backend. in my backend, I have this:</p>
<pre><code> app.post('/deleteDoc', (req, res) =&gt; {
    console.log(req.body.id)
})
</code></pre>
<p>however, when I run it, it goes back there, but shows <code>undefined</code> in my console.</p>
<p>any ideas why this may happen?</p>

